INSERT INTO `problem` VALUES (100,'demo test','<p>Calculate a + b.</p>','<p>&nbsp;</p>\n<p class=\"p1\">Two integers a and b, separated by a space. (0&lt;=a,b&lt;=9).</p>','<p>&nbsp;</p>\n<p class=\"p1\">The sum of a and b in the first line.</p>','5 7','12','0','<p class=\"p1\">&nbsp;</p>\n<p class=\"p1\">Your program should always read from stdin(Standard Input), and write to stdout(Standard Output). Solutions to this problem can be as follows:</p>\n<p class=\"p1\">&nbsp;</p>\n<p class=\"p1\">C:</p>\n<p class=\"p1\">#include</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">int main() {</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;int a, b;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;scanf(\"%d%d\", &amp;a, &amp;b);</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;printf(\"%d\\n\", a + b);</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;return 0;</p>\n<p class=\"p1\">}</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">C++:</p>\n<p class=\"p1\">#include</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">using namespace std;</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">int main() {</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;int a, b;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;cin &gt;&gt; a &gt;&gt; b;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;cout &lt;&lt; a + b &lt;&lt; endl;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;return 0;</p>\n<p class=\"p1\">}</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">Pascal:</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">var</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;a, b: Integer;</p>\n<p class=\"p1\">begin</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;readln(a, b);</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;writeln(a + b);</p>\n<p class=\"p1\">&nbsp;</p>\n<p class=\"p1\">end.</p>','','2016-06-19 15:39:27',1,10,'N',95,384,0),(1001,'isPrime(maxK-minK)','<p>&nbsp; &nbsp; N(0&lt;n&lt;=10000)a[i]maxlongint kkmm(0&lt;k&lt;=n)</p>','<p></p>\n<p>2nk</p>\n<p>n</p>','<p></p>\n<p>m</p>\n<p>\'YES\'(</p>\n<p>m</p>\n<p>&nbsp;</p>\n<p>\'NO\'</p>\n<p>m</p>','5 2\n1 2 3 4 5','YES\n2','0','<p>K:</p>\n<p>1 2 2 2 2 3</p>\n<p>1 3</p>\n<p>2 2</p>\n<p>3 2</p>\n<p>4 2</p>\n<p>5 1</p>\n<p>K</p>\n<p>&nbsp;</p>\n<p></p>\n<p>2,2,NO</p>','','2016-06-30 19:20:25',5,10,'Y',NULL,0,0),(10,'','<p><span style=\"color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; font-size: 13px; line-height: 26px; text-indent: 26px; background-color: rgba(255, 255, 255, 0.65098);\">&ldquo;N &rdquo;N 5 1~5 5 N N j v[j]w[j]k j1...jkv[j1]*w[j1]+..+v[jk]*w[jk].</span></p>','<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">1 </p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">N m</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">N&lt;30000m(&lt;25)</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">2 m+1 j j-1</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">2 </p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">v p</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">v v&le;10000p 1~5</p>','<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\"></p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">&lt;100000000</p>','1000 5\n800 2\n400 5\n300 5\n400 3\n200 2','3900','0','<p></p>','','2016-06-20 15:54:52',2,10,'Y',NULL,0,0),(1002,'Highest Scholarship','<p></p>\n<p>1) &nbsp; &nbsp; 800080&gt;8011</p>\n<p>&nbsp;</p>\n<p>2) &nbsp; &nbsp; 400085&gt;8580&gt;80</p>\n<p>&nbsp;</p>\n<p>3) &nbsp; &nbsp; 200090&gt;90</p>\n<p>&nbsp;</p>\n<p>4) &nbsp; &nbsp; 100085&gt;85</p>\n<p>&nbsp;</p>\n<p>5) &nbsp; &nbsp; 85080&gt;80</p>\n<p>&nbsp;</p>\n<p>87824850</p>\n<p>&nbsp;</p>\n<p></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','<p>&nbsp;N1 &lt;= N &lt;= 100N2001000100YN010010</p>','<p>N</p>','4\nYaoLin 87 82 Y N 0\nChenRuiyi 88 78 N Y 1\nLiXin 92 88 N N 0\nZhangQin 83 87 Y N 1\n','ChenRuiyi\n9000\n28700\n','0','','','2016-06-30 20:10:01',10,100,'Y',NULL,0,0),(1003,'Sea Bright Codes','<p class=\"p1\"><span class=\"s1\">Given N, B, and D: Find a set of N codewords (1 &lt;= N &lt;= 64), each of length B bits (1 &lt;= B &lt;= 8), such that each of the codewords is at least SB&nbsp;distance of D (1 &lt;= D &lt;= 7) away from each of the other codewords. The SB&nbsp;distance between a pair of codewords is the number of binary bits that differ in their binary notation. Consider the two codewords 0x554 and 0x234 and their differences (0x554 means the hexadecimal number with hex digits 5, 5, and 4):</span></p>\n<p class=\"p1\"><span class=\"s1\">0x554 = 0101 0101 0100 0x234 = 0010 0011 0100 Bit differences: xxx xx</span></p>\n<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Since five bits were different, the SB&nbsp;distance is 5.</span></p>','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">N, B, D on a single line</span></p>','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">N codewords, sorted, in decimal, ten per line. In the case of multiple solutions, your program should output the solution which, if interpreted as a base 2^B integer, would have the least value.</span></p>','16 7 3','0 7 25 30 42 45 51 52 75 76 82 85 97 102 120 127','0','<p class=\"p1\"><span class=\"s1\">There are only a few tools we need to solve this problem. First of all, we can use basic techniques to find the Nth bit of a number M: counting the least significant bit as bit 0, the next bit as bit 1, etc., we can find the value of that bit through the expression</span></p>\n<p class=\"p1\"><span class=\"s1\">int Nth_bit = (1 &lt;&lt; N) &amp; M;</span></p>\n<p class=\"p1\"><span class=\"s1\">In other words, we are shifting the number 1 left by N spaces, and then performing a binary AND on the resulting number with our original number, which will leave either a 1 in the Nth bit or a 0. So the first thing we have to do is find out the distance between each pair of numbers within the set of all numbers with B bits (0..2B-1).</span></p>\n<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">We also know that 0 can be one of the numbers in the set, because if the minimum number in the set were N instead of 0, we could XOR N to each number in the set and they would still be the same distance apart. The limits on the problem are low enough that we can do a DFS(depth first search), and as soon as we hit a solution we can output it and exit.</span></p>','','2016-07-01 01:33:06',5,10,'N',2,2,0),(101,'Summing a Series  ','<p>Sum a given integer series.</p>','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">&nbsp;series of positive integers, one per line. Proceed to the end of input.</span></p>','<p><span style=\"font-family: Arial, Helvetica, sans-serif, ;\"><span style=\"font-size: 14px;\">One integer, which is the sum of the input series. Our input guarantees the correct answer will never exceed&nbsp;</span></span><span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\"><span style=\"font-family: Arial, Helvetica, sans-serif, ;\"><span style=\"font-size: 14px;\">2</span></span></span><sup style=\"font-family: Arial, Helvetica, sans-serif, ; background-color: #e8e8ff;\">31</sup><span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">-1.</span></p>','3\n9\n7','19','0','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">How to detect the end of input?</span></p>','','2016-07-01 23:11:00',1,1,'N',74,254,0),(102,'Compass Moving','<p>You are given a tower of n disks, initially stacked in decreasing size on one of three pegs, your objective is to transfer the entire tower to one of the other pegs, moving only one disk at a time and never moving a larger one onto a smaller. &nbsp;</p>\n<p>For example, n = 2:</p>\n<p><a style=\"text-align: -webkit-center; background-color: #e8e8ff;\"><span style=\"background-color: #ffffff; font-size: 14px;\"><span style=\"font-family: Arial, Helvetica, sans-serif, ;\"><img src=\"data/102/102.png\" alt=\"hanoi\" /></span></span></a></p>\n<p>We need 3 moves to perform the task.</p>\n<p>&nbsp;</p>\n<p>Now the question arises: What\'s the best we can do? That is, how many moves are necessary and sufficient to perform the task? &nbsp; Please write a program to find out the minimum number of moves we need to do with n disks in the tower.</p>','<p>One positive integer, n (1 &lt;= n &lt;= 64).</p>','<p>One integer, the minimum number of moves needed.</p>','2','3','0','<p>The answer might be a huge integer which cannot be hold in a 32-bit int variable.</p>','','2016-07-01 23:17:21',5,10,'N',10,107,0),(103,'Prime Test','<p>A prime number (or prime integer, often simply called a \"prime\" for short) is a positive integer p&gt;1 that has no positive integer divisors other than 1 and p itself. &nbsp;For example, the only divisors of 13 are 1 and 13, making 13 a prime number, while the number 24 has divisors 1, 2, 3, 4, 6, 8, 12, and 24 (corresponding to the factorization 24=23*3), making 24 not a prime number. Positive integers other than 1 which are not prime are called composite numbers. &nbsp;Given an integer n, write a program to check whether n is a prime number or not.</p>','<p>One integer, n. (2&lt;=n&lt;=<span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, ; background-color: #e8e8ff;\">31</sup>&nbsp;-1).</p>','<p>Output \"YES\" if n is a prime number, otherwise \"NO\".</p>','2','YES','0','','','2016-07-01 23:29:40',2,32,'N',84,245,0),(104,'Prime Refactorying','<p><span style=\"font-family: Arial, Helvetica, sans-serif, ;\"><span style=\"font-size: 14px;\">For a given integer, Prime Refactorying is finding which prime numbers you need to multiply together to get the original number, also called prime decomposition. &nbsp; Given a positive integer n&gt;=2, the prime refactorying&nbsp;is written</span></span><br style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\" /><br style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\" /><em style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">n = p<sub>1</sub><sup>a<sub>1</sub></sup>p<sub>2</sub><sup>a<sub>2</sub></sup>...p<sub>k</sub><sup>a<sub>k</sub></sup></em><br style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\" /><br style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\" />where the pis are the k prime factors, each of order ai. &nbsp;</p>\n<p>Write a program to factor a given integer n.</p>\n<p>&nbsp;</p>','<p>&nbsp;</p>\n<p>One integer,n.(2&lt;=n&lt;=<span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, ; background-color: #e8e8ff;\">31</sup>-1).</p>','<p><span style=\"font-family: Arial, Helvetica, sans-serif, ;\"><span style=\"font-size: 14px;\">Output the refactorying of n as follows: &nbsp;</span></span></p>\n<p><span style=\"font-family: Arial, Helvetica, sans-serif, ;\"><span style=\"font-size: 14px;\">n=p1(a1)p2(a2)...pk(ak) &nbsp;Where p1&lt;p2&lt;...&lt;pk, and ai denotes the exponent of pi.</span></span></p>\n<p>For example,for n = 1500 =&nbsp;<span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, ; background-color: #e8e8ff;\">2</sup><span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">*3*5</span><sup style=\"font-family: Arial, Helvetica, sans-serif, ; background-color: #e8e8ff;\">3</sup>, the output should be:</p>\n<p><br style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\" /><br style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\" />1500=2(2)3(1)5(3)</p>','15','15=3(1)5(1)','0','','','2016-07-01 23:33:16',2,64,'N',9,34,0),(115,'','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\"></span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\"></span><span style=\"color: rgb(34, 34, 34); font-family: &quot;courier new&quot;, monospace; font-size: 15.4px; line-height: 19.6px;\">code</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\"></span><span style=\"color: rgb(34, 34, 34); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\"></span><span style=\"color: rgb(34, 34, 34); font-family: &quot;courier new&quot;, monospace; font-size: 15.4px; line-height: 19.6px;\">edoc</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\"></span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">st100</span></p>','<p><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">ts</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">YES</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">, &nbsp;</span><span class=\"tex-font-style-tt\" style=\"font-size: 15.4px; font-family: \'courier new\', monospace; color: #222222; line-height: 19.6px;\">NO</span><span style=\"color: #222222; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19.6px;\">.</span></p>','\ncode\nedoc\n\n\nabb\naba','YES\n\nNO','0','<p>implementationstrings</p>','','2016-07-20 23:08:29',2,64,'N',42,101,0),(106,'The last non-zero digit of n!','<p>Given an integer n, please output the last non-zero digit of n! &nbsp;</p>\n<p>For example, 5!=120, the last non-zero digit is 2, for 9!=362880 it is 8.</p>','<p><span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">One positive integer&nbsp;</span><em style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">n</em><span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">. (0&lt;</span><em style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">n</em><span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">&lt;10</span><sup style=\"font-family: Arial, Helvetica, sans-serif, ; background-color: #e8e8ff;\">10001</sup><span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">)</span></p>','<p>The last non-zero digit of n!</p>','1','1','0','','','2016-07-02 13:55:51',5,64,'N',1,15,0),(107,'a^b mod c','<p>The calculation of&nbsp;<em style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: rgb(232, 232, 255);\"><strong>a<sup>b</sup>&nbsp;mod c</strong></em>&nbsp;arises in many fields of computer science, this time we brought it to you, can you prove us your talent?</p>','<p>Three integers, a, b, c. (1&lt;=a,b,c&lt;=<span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, ; background-color: #e8e8ff;\">31</sup>-1)</p>','<p>One integer, the result of&nbsp;<em style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">a</em><sup style=\"font-family: Arial, Helvetica, sans-serif, ; background-color: #e8e8ff;\"><em>b</em></sup>&nbsp;mod c.</p>','3 7 15','12','0','<p>The operator mod is defined as calculating the reminder of a divides b. For example, 5 mod 1 = 0, 5 mod 2 = 1, 5 mod 3 = 2, 5 mod 4 = 1, 5 mod 5 = 0, 5 mod 6 = 5, 5 mod 7 = 5, 5 mod 8 = 5, etc. &nbsp;</p>\n<p>The operator mod has following properties:</p>\n<p>(a + b) mod c = ((a mod c) + b) mod c &nbsp;</p>\n<p>(a - b) mod c = ((a mod c) - b) mod c &nbsp;</p>\n<p>(a * b) mod c = ((a mod c) * b) mod c &nbsp;</p>\n<p>It is obvious that (a + b) mod c = ((a mod c) + (b mod c)) mod c, and etc.</p>','','2016-07-02 14:04:50',1,64,'N',1,24,0),(108,'BCD and SCM','<p>In mathematics, privided N positive integers,there exists maximum integer which can be divided among those integers without remainder,meanwhile,there exists minmum integer which can divide each of those intergers without remainds.</p>\n<p>In this problem, we define the BCD of an integer series as the largest positive integer that divides every number of that series without remainder. And the SCM of an integer series as the smallest positive integer that is a multiple of every number of the series. &nbsp;</p>\n<p>For example, for the following integer series: &nbsp;</p>\n<p>8 16 12 24 &nbsp;</p>\n<p>We have&nbsp;BCD&nbsp;= 4 and&nbsp;SCM&nbsp;= 48. &nbsp;</p>\n<p>You are given an non-negative integer series, please calculate its&nbsp;BCD&nbsp;and&nbsp;SCM.</p>','<p>The input will consist of a number of non-negative integers, one per line. Proceed to the end of input.</p>','<p>Two integers, the series\' BCD and SCM, separated by a single space. Our input guarantees the correct answer will never exceed&nbsp;<span style=\"font-family: Arial, Helvetica, sans-serif, ; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, ; background-color: #e8e8ff;\">63</sup>-1.</p>','8 16 12 24','4\n48','0','','','2016-07-02 14:20:52',1,64,'N',1,1,0),(1004,'Ali Baba and the 40 Robbers','<p class=\"p1\"><span class=\"s1\">One day, Alibaba, as usual, drives his three donkeys to the forest to collect woods. After his hard work, finally he gets enough woods. ?He puts the woods on the back of these donkeys and goes home happily. Just after he goes through a high mountain, he sees a cloud of dust. It seems to have a group of people coming. ?He has been warned that there are a lot of thieves around this area recently. So he ties the donkeys to a tree, hiding himself behind a large rock.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Just a while, these people come, with the horses fully-loaded. Ali Baba don\'t know what\'s in the bags. However, he is sure that they are not to woods. The group has 40 persons. Ali Baba decides to see what makes them to take so many things to the mountains.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">The group of people come to a foot of the mountain. Ali Baba follows them there quietly. He knew that once found he would be killed. Though they speak briefly in a low voice, he is fully aware of the fact that this is a group of robbers and the things are stolen. However, why they took things at the foot of this mountain? Ali Baba decides to continue observing.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">The robber leader go in front of the mountain, says: \"Open, Simsim.\" As a big piece of stone answers and removes. There is a cave.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">The robbers move the things into the cave and then come out. The robber leader says: \"Close, Simsim.\" and the stone move back. The cave disappeared. Then the group of robbers go back.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Ali Baba remember this place and the sentence. Of course, he is very surprised about what has happened.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Ali Baba decides to take a look at the hidden treasures. He waits until the the robbers go far away, then come to the front of the cave.</span></p>\n<p class=\"p1\"><span class=\"s1\">He has never done such a thing. The legs has begun shaking up. However, he eventually encourages himself and shouts loudly: \"Open, Simsim.\"</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">the stone removes and exposes a black hole. He goes into cave and is shocked by the scene inside. ?This is a very large cave, which is full of valuable gold, silver, jewelry and jade. He has never seen so many treasures in all his life. ?Ali Baba is a bit afraid of the robbers\' returning. So he runs back to the hole. However, Ali Baba thinks, why not take some back, as he has already here?</span></p>\n<p class=\"p2\"><span class=\"s1\">&nbsp;</span></p>\n<p class=\"p1\"><span class=\"s1\">So he throw away all the woods on the dunkeys in order to fill three large bags with treasures inside, and then out of the cave. \"Close, Simsim.\" Ali Baba says. The stone then block the hole.&nbsp;</span></p>\n<p class=\"p1\"><span class=\"s1\">Ali Baba leads the donkey to the forests, covered the treasure with wood in order to avoid any suspicion of oth</span>ers, and then goes home happily.</p>','<p>Each test data has two positive integer N, K (1&le;K&le;N&le;1000), separate by a space character.</p>\n<p>N is number of all drawers;K is number of breaked drawers.</p>','<p>Output the float number of the answer. Accurate to three digits after decimal point.</p>','3 1','0.333','0','','','2016-07-02 14:57:30',1,64,'Y',NULL,0,0),(105,'Round Robin Killing','<p>n men stands in a format of circle under the commander that every <span style=\"font-size: 14px;\">m</span><sup style=\"font-family: Arial, Helvetica, sans-serif, ; background-color: #e8e8ff;\">th&nbsp;</sup>man will be executed going around the circle until only one remains, find the position L(n,m) of the circle&nbsp;where&nbsp;you should stand in order to be the last survivor. &nbsp;</p>\n<p>For example, n = 5 and m = 2, we number everyone from 1 to n based on their positions, and the entire process will be as follows:</p>\n<p><img src=\"/data/105/105.png\" alt=\"Josephus\" /></p>\n<p>In this case we should stand at position 3 thus we can escape from being executed. &nbsp;</p>\n<p>&nbsp;</p>\n<p>Now you are given n and m, your task is to write a program to find the position of the last survivor.</p>','<p>Two integers n and m, separated by a single space. (1 &lt;= n, m &lt;= 1000000).</p>','<p>One integer, the position of the last survivor.</p>','5 2','3','0','','','2016-07-02 03:02:40',1,64,'N',15,50,0),(109,'','<p> <span style=\"font-size: 16px;\">T</span><sup style=\"font-family: &quot;Times New Roman&quot;, Times, serif;\">n&nbsp;</sup>&nbsp;<span style=\"font-family: &quot;Times New Roman&quot;, Times, serif; font-size: 16px;\">&nbsp;0.0 &lt; T &lt; 99.999 0 &lt; n &lt;= 25</span></p>','<p> T nT16n89</p>','<p><span style=\"font-size: 16px;\">T</span><sup style=\"font-family: &quot;Times New Roman&quot;, Times, serif;\">n</sup>