 service), the knight receives four gold coins. This pattern of payments will continue indefinitely: after receiving N gold coins on each of N consecutive days, the knight will receive N+1 gold coins on each of the next N+1 consecutive days, where N is any positive integer. &nbsp; Your program will determine the total number of gold coins paid to the knight in any given number of days (starting from Day 1).&nbsp;</p>','<p>The input contains at least one, but no more than 21 lines. Each line of the input file (except the last one) contains data for one test case of the problem, consisting of exactly one integer (in the range 1..10000), representing the number of days. The end of the input is signaled by a line containing the number 0.</p>','<p>There is exactly one line of output for each test case. This line contains the number of days from the corresponding line of input, followed by one blank space and the total number of gold coins paid to the knight in the given number of days, starting with Day 1.</p>','10\n6\n7\n11\n15\n16\n100\n10000\n1000\n21\n22\n0','10 30\n6 14\n7 18\n11 35\n15 55\n16 61\n100 945\n10000 942820\n1000 29820\n21 91\n22 98','0','','','2016-07-03 23:58:20',1,64,'N',2,2,0),(1006,'N','<p>KKNM</p>\n<p>11&lsquo;1&rsquo;11111111136&ldquo;1&rdquo;</p>','<p>NMM10000</p>','<p>N0</p>','1 5 \n1 11 \n1 13','0\n2\n6','0','','','2016-07-06 01:40:44',1,64,'N',2,7,0),(110,'','<p></p>','<p>&ldquo;+&rdquo;&ldquo;*&rdquo;02^31-10~ 9+*12</p>','<p><strong>440</strong></p>','1+1*3+4\n1+1234567890*1\n1+1000000003*1','8\n7891\n4','0','<p>30%0&le;&le;100</p>\n<p>80%0&le;&le;1000</p>\n<p>100%0&le;&le;100000</p>','','2016-07-08 01:37:56',1,64,'N',2,3,0),(1008,' ','<p>&nbsp; &nbsp; &nbsp;&nbsp;50%50%() &nbsp;</p>','<p>NNn (n&lt;=20)n80 &nbsp; 10001~n&hellip; &nbsp;&nbsp;</p>\n<p>&nbsp;</p>','<p> &nbsp;</p>\n<p></p>','1\n3\nJohn Terry\nJane Smith\nMark Hughes\n1 2 3\n2 1 3\n2 3 1\n1 2 3\n3 1 2','John Terry','0','','','2016-07-08 19:38:42',3,64,'N',1,2,0),(1009,'','<p>OJ &l