INSERT INTO `source_code` VALUES (1001,'#include <stdio.h>\nint main() {int a, b;\n    scanf(\"%d%d\", &a, &b);\n    printf(\"%d\\n\", a + b);\n    return 0;\n\n}'),(1002,'#include\n \nint main() {\n    int a, b;\n    scanf(\"%d%d\", &a, &b);\n    printf(\"%d\\n\", a + b);\n    return 0;\n}'),(1003,'import java.util.Scanner;\n\npublic class Main {\n    static int N,B,D;\n	public static void main(String[] args) {\n		Scanner scan = new Scanner(System.in);\n		N = scan.nextInt();\n		B = scan.nextInt();\n		D = scan.nextInt();\n		\n		int[] result = new int[N];\n		result[0]=0;\n		for(int i=1;i<N;i++){\n			int index=1;\n			while(index<=Math.pow(2, B)){\n				boolean isHamming = true;\n				for(int j=0;j<i;j++){\n					if(getHammingDis(result[j],index)==false){\n						isHamming = false;\n						break;\n					}\n				}\n				if(isHamming == true){\n					result[i] = index;\n					break;\n				}\n				index++;\n			}\n		}\n		for(int i=0;i<N;i++){\n			System.out.print(result[i]+\" \");\n		}\n	}\n    \n	\n	public static boolean getHammingDis(int a,int b){\n		int difNum = 0 ;\n		for(int i=0;i<B;i++){\n			int a1 = a&(1<<i);\n			int b1 = b&(1<<i);\n			if(a1!=b1)\n				difNum ++;\n			if(difNum>=D)\n				return true;\n		}\n		\n		return false;\n	}\n}'),(1004,'import java.util.Scanner;\n\npublic class Main {\n    static int N,B,D;\n	public static void main(String[] args) {\n		Scanner scan = new Scanner(System.in);\n		N = scan.nextInt();\n		B = scan.nextInt();\n		D = scan.nextInt();\n		\n		int[] result = new int[N];\n		result[0]=0;\n		for(int i=1;i<N;i++){\n			int index=1;\n			while(index<=Math.pow(2, B)){\n				boolean isHamming = true;\n				for(int j=0;j<i;j++){\n					if(getHammingDis(result[j],index)==false){\n						isHamming = false;\n						break;\n					}\n				}\n				if(isHamming == true){\n					result[i] = index;\n					break;\n				}\n				index++;\n			}\n		}\n		for(int i=0;i<N;i++){\n			System.out.print(result[i]);\n			System.out.print(\" \");\n		}\n	}\n    \n	\n	public static boolean getHammingDis(int a,int b){\n		int difNum = 0 ;\n		for(int i=0;i<B;i++){\n			int a1 = a&(1<<i);\n			int b1 = b&(1<<i);\n			if(a1!=b1)\n				difNum ++;\n			if(difNum>=D)\n				return true;\n		}\n		\n		return false;\n	}\n}'),(1005,'import java.math.BigDecimal;\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		Scanner cin=new Scanner(System.in);\n        while(cin.hasNext())\n        {\n            BigDecimal r=cin.nextBigDecimal();\n            int n=cin.nextInt();\n            r=r.pow(n).stripTrailingZeros();//\n            String m_string=r.toPlainString();//\n            if(m_string.charAt(0)==\'0\')\n            m_string=m_string.substring(1);\n            System.out.println(m_string);\n        }\n\n	}\n\n}'),(1006,'#include <iostream>\nusing namespace std;\n#define ULL unsigned long long\n\nULL mul_mod (ULL a, ULL b, ULL c) \n{\n    ULL res = 0;\n    for ( ; b; b >>= 1)\n    {\n        if (b & 1)\n        {\n            res += a;   \n            if (res >= c) res -= c;\n        }\n        a <<= 1;    \n        if (a >= c) a -= c;\n    }\n    return res;\n}\n\nULL qmod (ULL a, ULL b, ULL c)\n{\n    ULL res = 1;\n    for ( ; b; b >>= 1)\n    {\n        if (b & 1)\n            res = mul_mod (a, res, c);\n        a = mul_mod (a, a, c);\n    }\n    return res;\n}\n\nint main()\n{\n    ULL a, b, c;\n    if (~scanf (\"%lld%lld%lld\", &a, &b, &c))\n        printf (\"%lld\\n\", qmod (a%c, b, c));\n    return 0;\n}\n'),(1007,'import java.util.*;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		ArrayList<Long> inputs = new ArrayList<Long>();\n		Scanner scan = new Scanner(System.in);// \n		long num1 = 0, num2 = 0;\n\n		if (scan.hasNextLine()) {\n			String inputStr = scan.nextLine();\n			String[] vars = inputStr.split(\" \");\n			for (int i = 0; i < vars.length; i++) {\n				long temp = Long.valueOf(vars[i]);\n				inputs.add(temp);\n				if (num1 == 0)\n					num1 = temp;\n				else {\n					num2 = temp;\n					num1 = maxCommonDivisor(num1, num2);\n				}\n\n			}\n\n			System.out.println(num1);// maxCommonDivisor()\n			System.out.println(minCommonMultiple(inputs, num1));// minCommonMultiple()\n		}\n	}\n\n	// \n	public static long maxCommonDivisor(long m, long n) {\n		if (m < n) {// m>n,m<n,\n			long temp = m;\n			m = n;\n			n = temp;\n		}\n		if (m % n == 0) {// 0,\n			return n;\n		} else { // ,,nm,n\n			return maxCommonDivisor(n, m % n);\n		}\n	}\n\n	// \n	public static long maxCommonDivisor2(long m, long n) {\n\n		if (m < n) {// m>n,m<n,\n			long temp = m;\n			m = n;\n			n = temp;\n		}\n		while (m % n != 0) {// 0,\n			long temp = m % n;\n			m = n;\n			n = temp;\n		}\n		return n;// \n	}\n\n	// \n	public static long minCommonMultiple(long m, long n) {\n		return m * n / maxCommonDivisor(m, n);\n	}\n\n	// \n	public static long minCommonMultiple(ArrayList<Long> array, long maxDivisor) {\n		long min = minCommonMultiple(array.get(0),array.get(1));\n		for (int i = 2; i < array.size(); i++) {\n			min = minCommonMultiple(array.get(i),min);\n		}\n\n		return min;\n	}\n\n}\n'),(1008,'import java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String argv[]) {\n\n		Scanner scan = new Scanner(System.in);\n		int N = scan.nextInt();\n		if(isPrime(N)){\n			System.out.print(\"YES\");\n		}else\n			System.out.print(\"NO\");\n\n	}\n\n	private static boolean isPrime(int n) {\n		if (n <= 1) {\n			return false;\n		}\n		int k = (int) Math.sqrt(n);\n		for (int i = 2; i <= k; i++) {\n			if (n % i == 0) {\n				return false;\n			}\n		}\n		return true;\n	}\n\n}'),(1009,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Summing {\n\n	public static void main(String[] args) {\n		ArrayList<Integer> inputs = new ArrayList<Integer>();\n		Scanner scan = new Scanner(System.in);\n		while(scan.hasNext()){\n			String str = scan.nextLine();\n			try{\n				int i = Integer.valueOf(str);\n				inputs.add(i);\n			}catch(NumberFormatException e){\n				break;\n			}\n		}\n		scan.close();\n        int add = 0;\n		for(int i=0;i<inputs.size();i++){\n			add += inputs.get(i);\n		}\n		System.out.print(add);\n	}\n\n}'),(1010,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		ArrayList<Integer> inputs = new ArrayList<Integer>();\n		Scanner scan = new Scanner(System.in);\n		while(scan.hasNext()){\n			String str = scan.nextLine();\n			try{\n				int i = Integer.valueOf(str);\n				inputs.add(i);\n			}catch(NumberFormatException e){\n				break;\n			}\n		}\n		scan.close();\n        int add = 0;\n		for(int i=0;i<inputs.size();i++){\n			add += inputs.get(i);\n		}\n		System.out.print(add);\n	}\n\n}'),(1011,'import java.math.BigDecimal;\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		// TODO Auto-generated method stub\n		Scanner scan = new Scanner(System.in);\n		double n = scan.nextInt();\n		System.out.print(new BigDecimal(calHanoi(n)));\n	}\n    \n	private static double calHanoi(double n){\n		if(n==1)\n			return 1;\n		else if(n==2)\n			return 3;\n		else{\n			return 2*calHanoi(n-1);\n		}\n	}\n}'),(1012,'import java.util.ArrayList;\nimport java.util.HashMap;\nimport java.util.Scanner;\n\npublic class Main {\n\n	static HashMap<Integer,Integer> factors = new HashMap<Integer,Integer>();\n	static ArrayList<Integer> keys = new ArrayList<Integer>();\n	\n	public static void primeFactors(int numbers) {\n		int n = numbers;\n		\n		for (int i = 2; i <= n / i; i++) {\n			while (n % i == 0) {\n				if(factors.containsKey(i))\n					factors.put(i, factors.get(i)+1);\n				else{\n					factors.put(i, 1);\n					keys.add(i);\n				}\n				\n				n /= i;\n			}\n		}\n		if (n > 1) {\n			factors.put(n, 1);\n			keys.add(n);\n		}\n	}\n\n	public static void main(String[] args) {\n		StringBuffer buffer =new StringBuffer();\n		Scanner scan = new Scanner(System.in);\n		primeFactors(scan.nextInt());\n		\n		for (Integer i : keys) {\n			buffer.append(i+\"(\"+factors.get(i)+\")\");\n		}\n		\n		System.out.println(buffer.toString());\n\n	}\n\n}'),(1013,'import java.util.Scanner;\n\npublic class Main {\n   \n	static int N;\n	static int K;\n	public static void main(String[] args) {\n		Scanner scan = new Scanner(System.in);\n		N = scan.nextInt();\n		K = scan.nextInt();\n		\n		int survior = 1;\n		for(int i=2;i<=N;i++){\n			survior = (survior+K)%i;\n			if(survior == 0)//the i-th position\n				survior = i;\n		}\n		System.out.print(survior);\n	}\n    \n}'),(1014,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) {\n		// TODO Auto-generated method stub\n		ArrayList<String> results = new ArrayList<String>();\n		Scanner scan = new Scanner(System.in);// \n		while(scan.hasNext()){\n			int day = scan.nextInt();\n			if(day==0)\n				break;\n			int dMoney = getDailyMoney(day);\n			int money =0;\n			for(int i=1;i<=dMoney;i++){\n				money+=i*i;\n			}\n			money+=(day-dMoney*(dMoney+1)/2)*(dMoney+1);\n			results.add(day+\" \"+money);\n		}\n		\n		for(int i=0;i<results.size()-1;i++){\n			System.out.println(results.get(i));\n		}\n		System.out.print(results.get(results.size()-1));\n	}\n    \n	static int getDailyMoney(int day){\n		int num = day*2;\n		int money = (int)Math.pow(num,0.5);\n		if(money*(money+1)>num)\n			return money-1;\n		return money;\n	}\n}'),(1015,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n\n	static ArrayList<Integer> results = new ArrayList<Integer>();\n\n	public static void main(String argv[]) {\n\n		Scanner scan = new Scanner(System.in);\n		while (scan.hasNext()) {\n			String str = scan.nextLine();\n			try {\n				String[] pairs = str.split(\" \");\n				if (pairs == null || pairs.length != 2) {\n					break;\n				}\n				results.add(getLengthOfN(Integer.valueOf(pairs[0]), Integer.valueOf(pairs[1])));\n\n			} catch (NumberFormatException e) {\n				break;\n			}\n		}\n		scan.close();\n\n		for (int i = 0; i < results.size(); i++) {\n			System.out.println(results.get(i));\n		}\n\n	}\n\n	public static int gys(int a, int b) // gongyueshu\n	{\n		if (a == 0)\n			return b;\n		return gys(b % a, a);\n	}\n\n	public static int getLengthOfN(int n, int k) {\n		int temp = gys(n, k);\n		k = k / temp;\n		if (((k & 1) == 0) || ((k % 5) == 0)) {\n			return 0;\n		}\n\n		n = n / temp;\n		int c = 0, i = 0;\n		do {\n			c = (c * 10 + 1) % k;\n			i++;\n		} while (c != 0);\n		return i;\n	}\n}\n'),(1016,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) throws Exception {\n\n		Scanner scan = new Scanner(System.in);\n		String line = scan.nextLine();\n		int testCases = Integer.parseInt(line);\n\n		line = scan.nextLine(); // read the empty line\n\n		while (testCases-- > 0) {\n\n			line = scan.nextLine();\n			if (line.length() == 0) {\n				testCases++;\n				continue;\n			}\n\n			int n = Integer.parseInt(line);\n			String[] names = new String[n];\n\n			for (int i = 0; i < n; i++)\n				names[i] = scan.nextLine();\n\n			ArrayList<Integer[]> results = new ArrayList<Integer[]>();\n\n			while (true) {\n\n				line = scan.nextLine();\n				if (line == null || line.length() == 0)\n					break;\n\n				line = line.trim();\n				Integer[] ballot = new Integer[n];\n\n				String[] parts = line.split(\"\\\\s+\");\n\n				for (int i = 0; i < parts.length; i++)\n					ballot[i] = Integer.parseInt(parts[i]) - 1;\n\n				results.add(ballot);\n\n			}\n\n			Boolean[] blacklist = new Boolean[n];\n			for (int i = 0; i < n; i++) {\n				blacklist[i] = false;\n			}\n\n			ArrayList<Integer> winners = new ArrayList<Integer>();\n\n			while (true) {\n\n				Integer[] sum = new Integer[n];\n				for (int i = 0; i < n; i++)\n					sum[i] = 0;\n\n				int max = 0;\n				int maxChoice = -1;\n\n				for (int i = 0; i < results.size(); i++) {\n					Integer[] r = results.get(i);\n					int choice = -1;\n					for (int j = 0; j < n; j++) {\n						if (!blacklist[r[j]]) {\n							choice = r[j];\n							break;\n						}\n					}\n\n					sum[choice]++;\n					if (sum[choice] > max) {\n						max = sum[choice];\n						maxChoice = choice;\n					}\n				}\n\n				if (max * 2 > results.size()) {\n					winners.add(maxChoice);\n					break;\n				} else {\n\n					int min = results.size();\n					for (int i = 0; i < n; i++) {\n						if (!blacklist[i] && (sum[i] < min))\n							min = sum[i];\n					}\n\n					for (int i = 0; i < n; i++) {\n						if ((!blacklist[i]) && (sum[i] == min)) {\n							if (min == max) {\n								winners.add(i);\n							} else {\n								blacklist[i] = true;\n							}\n						}\n					}\n\n					if (min == max)\n						break;\n\n				}\n\n			}\n\n			for (int i = 0; i < winners.size(); i++) {\n				System.out.println(names[winners.get(i)]);\n			}\n\n			if (testCases > 0)\n				System.out.println();\n\n		}\n\n	}\n\n}\n'),(1017,'import java.util.ArrayList;\nimport java.util.Scanner;\n\npublic class Main {\n\n	public static void main(String[] args) throws Exception {\n\n		Scanner scan = new Scanner(System.in);// \n		String line = scan.nextLine();\n		int testCases = Integer.parseInt(line);\n\n		line = scan.nextLine(); // read the empty line\n\n		while (testCases-- > 0) {\n\n			line = scan.nextLine();\n			if (line.length() == 0) {\n				testCases++;\n				continue;\n			}\n\n			int n = Integer.parseInt(line);\n			String[] names = new String[n];\n\n			for (int i = 0; i < n; i++)\n				names[i] = scan.nextLine();\n\n			ArrayList<Integer[]> results = new ArrayList<Integer[]>();\n\n			while (true) {\n                if(!scan.hasNext())\n                	break;\n				line = scan.nextLine();\n				if (line == null || line.length() == 0)\n					break;\n\n				line = line.trim();\n				Integer[] ballot = new Integer[n];\n\n				String[] parts = line.split(\"\\\\s+\");\n\n				for (int i = 0; i < parts.length; i++)\n					ballot[i] = Integer.parseInt(parts[i]) - 1;\n\n				results.add(ballot);\n\n			}\n\n			Boolean[] blacklist = new Boolean[n];\n			for (int i = 0; i < n; i++) {\n				blacklist[i] = false;\n			}\n\n			ArrayList<Integer> winners = new ArrayList<Integer>();\n\n			while (true) {\n\n				Integer[] sum = new Integer[n];\n				for (int i = 0; i < n; i++)\n					sum[i] = 0;\n\n				int max = 0;\n				int maxChoice = -1;\n\n				for (int i = 0; i < results.size(); i++) {\n					Integer[] r = results.get(i);\n					int choice = -1;\n					for (int j = 0; j < n; j++) {\n						if (!blacklist[r[j]]) {\n							choice = r[j];\n							break;\n						}\n					}\n\n					sum[choice]++;\n					if (sum[choice] > max) {\n						max = sum[choice];\n						maxChoice = choice;\n					}\n				}\n\n				if (max * 2 > results.size()) {\n					winners.add(maxChoice);\n					break;\n				} else {\n\n					int min = results.size();\n					for (int i = 0; i < n; i++) {\n						if (!blacklist[i] && (sum[i] < min))\n							min = sum[i];\n					}\n\n					for (int i = 0; i < n; i++) {\n						if ((!blacklist[i]) && (sum[i] == min)) {\n							if (min == max) {\n								winners.add(i);\n							} else {\n								blacklist[i] = true;\n							}\n						}\n					}\n\n					if (min == max)\n						break;\n\n				}\n\n			}\n\n			for (int i = 0; i < winners.size(); i++) {\n				System.out.println(names[winners.get(i)]);\n			}\n\n			if (testCases > 0)\n				System.out.println();\n\n		}\n\n	}\n\n}\n'),(1018,'import java.util.Scanner;\n\npublic class Main {\n	public static void main(String[] args) throws Exception {\n\n		Scanner scan = new Scanner(System.in);// \n		int run = 0;\n\n		while (true) {\n			run++;\n			String line = scan.nextLine();\n			int n = Integer.parseInt(line);\n			if (n == 0)\n				break;\n\n			StringBuilder goodLines = new StringBuilder();\n			StringBuilder goodNums = new StringBuilder();\n			buildCom(scan, n, goodLines, goodNums);\n\n			int m = Integer.parseInt(scan.nextLine());\n			StringBuilder inLines = new StringBuilder();\n			StringBuilder inNums = new StringBuilder();\n			buildCom(scan, m, inLines, inNums);\n\n			System.out.print(\"Run #\");\n			System.out.print(run);\n			System.out.print(\": \");\n\n			if (goodLines.toString().compareTo(inLines.toString()) == 0) {\n				System.out.println(\"Accepted\");\n			} else if (goodNums.toString().compareTo(inNums.toString()) == 0) {\n				System.out.println(\"Presentation Error\");\n			} else {\n				System.out.println(\"Wrong Answer\");\n			}\n\n		}\n\n	}\n\n	static void buildCom(Scanner reader, int numberOfLines, StringBuilder lines, StringBuilder nums) throws Exception {\n		String line;\n		for (int i = 0; i < numberOfLines; i++) {\n			line = reader.nextLine();\n			lines.append(line + \'\\n\');\n\n			for (int j = 0; j < line.length(); j++) {\n				if (Character.isDigit(line.charAt(j))) {\n					nums.append(line.charAt(j));\n				}\n			}\n		}\n		return;\n\n	}\n\n}'),(1019,'#include <cstdio>\nlong long int num[100005];\nchar sign[100005], temp[4];\nint lv[100005], signlv[260];\nint topn, tops;\nlong long int number;\nlong long int f(char s) {\n	switch (s) {\n	case \'+\':\n		return (num[topn] + num[topn + 1]) % 10000;\n	case \'*\':\n		return (num[topn] * num[topn + 1]) % 10000;\n	default:\n		return -1;\n	}\n	return -1;\n}\nvoid init() {\n	lv[0] = -1;\n	signlv[\'+\'] = 1;\n	signlv[\'*\'] = 2;\n	return ;\n}\nvoid solve() {\n	char tt;\n	while ((tt = getchar()) != \'\\n\') {\n		switch (tt) {\n		case \'+\':\n		case \'*\': {\n			num[++topn] = number;\n			number = 0;\n			if (lv[tops] < signlv[tt])\n				++tops;\n			else\n				num[--topn] = f(sign[tops]);\n			sign[tops] = tt;\n			lv[tops] = signlv[tt];\n			break;\n		}\n		default: {\n			number = number * 10 + tt - \'0\';\n			break;\n		}\n		}\n	}\n	num[++topn]= number;\n	while (tops)\n		num[--topn] = f(sign[tops--]);\n	return ;\n}\nvoid output() {\n	bool flag = false;\n	temp[0] = num[1] % 10;\n	temp[1] = (num[1] /= 10) % 10;\n	temp[2] = (num[1] /= 10) % 10;\n	temp[3] = (num[1] /= 10) % 10;\n	if (!temp[0] && !temp[1] && !temp[2] && !temp[3]) {\n		putchar(\'0\');\n		putchar(\'\\n\');\n		return ;\n	}\n	if (temp[3] || flag) {\n		putchar(temp[3] + \'0\');\n		flag = true;\n	}\n	if (temp[2] || flag) {\n		putchar(temp[2] 